import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { fetchBirthdays, createBirthday, updateBirthday, deleteBirthday } from '../services/api';

const BirthdayForm = ({ onSubmit, initialData, onCancel }) => {
  const [birthdayData, setBirthdayData] = useState({ name: '', date: '' });

  useEffect(() => {
    if (initialData) {
      setBirthdayData(initialData);
    }
  }, [initialData]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setBirthdayData({ ...birthdayData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit(birthdayData);
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        name="name"
        placeholder="Name"
        value={birthdayData.name}
        onChange={handleChange}
        required
      />
      <input
        type="date"
        name="date"
        value={birthdayData.date}
        onChange={handleChange}
        required
      />
      <button type="submit">{initialData ? 'Update Birthday' : 'Add Birthday'}</button>
      <button type="button" onClick={onCancel}>Cancel</button>
    </form>
  );
};

const BirthdayList = ({ birthdays, onEdit, onDelete }) => (
  <ul>
    {birthdays.length > 0 ? (
      birthdays.map((birthday) => (
        <li key={birthday.id}>
          {birthday.name} - {birthday.date}
          <button onClick={() => onEdit(birthday)}>Edit</button>
          <button onClick={() => onDelete(birthday.id)}>Delete</button>
        </li>
      ))
    ) : (
      <li>No birthdays found.</li>
    )}
  </ul>
);

const Birthdays = () => {
  const [birthdays, setBirthdays] = useState([]);
  const [editId, setEditId] = useState(null);
  const [error, setError] = useState(null);
  const token = localStorage.getItem('token');
  const navigate = useNavigate();

  useEffect(() => {
    const loadBirthdays = async () => {
      try {
        const data = await fetchBirthdays(token);
        setBirthdays(data);
      } catch (err) {
        setError(err.detail || 'Error fetching birthdays');
      }
    };
    loadBirthdays();
  }, [token]);

  const handleSubmit = async (birthdayData) => {
    try {
      if (editId) {
        await updateBirthday(editId, birthdayData, token);
        setEditId(null);
      } else {
        await createBirthday(birthdayData, token);
      }
      setBirthdayData({ name: '', date: '' }); // Reset form
      const data = await fetchBirthdays(token); // Re-fetch birthdays
      setBirthdays(data);
    } catch (error) {
      setError('Error saving birthday: ' + (error.detail || 'An error occurred.'));
    }
  };

  const handleEdit = (birthday) => {
    setEditId(birthday.id);
    setBirthdayData({ name: birthday.name, date: birthday.date }); // Populate form for editing
  };

  const handleDelete = async (id) => {
    try {
      await deleteBirthday(id, token);
      const data = await fetchBirthdays(token);
      setBirthdays(data);
    } catch (error) {
      setError('Error deleting birthday: ' + (error.detail || 'An error occurred.'));
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  return (
    <div>
      <h2>Birthdays</h2>
      {error && <div style={{ color: 'red' }}>{error}</div>}
      <button onClick={handleLogout}>Logout</button>
      <BirthdayForm onSubmit={handleSubmit} initialData={editId ? { name: birthdays.find(b => b.id === editId).name, date: birthdays.find(b => b.id === editId).date } : null} />
      <BirthdayList birthdays={birthdays} onEdit={handleEdit} onDelete={handleDelete} />
    </div>
  );
};

export default Birthdays;
